import React from "react";

import manoSpock from "../../images/engranaje.png";

import { motion } from "framer";

import "./Background.css";

const Background = () => {
  return (
    <div className="Background">
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 90 }}
        style={{
          position: "absolute",
          top: "5vw",
          left: "6vw",
          width: "15vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 90 }}
        style={{
          position: "absolute",
          bottom: "5vw",
          left: "8vw",
          width: "15vw",
          opacity: 0.5,
        }}
      />
      <motion.img
        src={manoSpock}
        alt="Mano Spock"
        animate={{ rotateY: 360 }}
        transition={{ loop: Infinity, ease: "linear", duration: 90 }}
        style={{
          position: "absolute",
          top: "3vw",
          right: "5vw",
          width: "15vw",
          opacity: 0.5,
        }}
      />
    </div>
  );
};

export default Background;
